import React from "react";
import { TextField } from "@mui/material";

import HorizontalBar from "./HorizontalBar";
import Panel from "./Panel";
import Text from "./Text";

export default function AddFlight({ data }) {
  const styles = {
    container: {
      marginLeft: "1em",
      flex: 3,
    },
    header: {
      display: "flex",
      alignItems: "flex-end",
    },
    headerText: {
      fontSize: 21,
    },
    body: {
      display: "flex",
      flexDirection: "column",
      padding: "2em 4em",
      height: "64vh",
      overflowY: "scroll",
    },
    direction: {
      display: "flex",
      flexDirection: "row",
      flex: 1,
      justifyContent: "space-between",
    },
    directionText: {
      fontSize: 34,
      fontWeight: "bold",
    },
    row: {
      display: "flex",
      flexDirection: "row",
      flex: 1,
      justifyContent: "space-between",
    },
    label: {
      fontSize: 18,
    },
    value: {
      fontSize: 18,
      fontWeight: "bold",
    },
    section: {
      marginTop: "1em",
    },
  };

  const { departure, arrival, from, to, type, flight } = {
    departure: "12:30 AM",
    arrival: "2:20 AM",
    from: "DCA",
    to: "DFW",
    type: "Boeing 747-800",
    flight: "AA 2010",
  };
  const bids = [{ name: "John Doe", price: "300" }];
  return (
    <Panel style={styles.container}>
      <div style={styles.header}>
        <Text style={styles.headerText}>Add Flight</Text>
      </div>
      <HorizontalBar height={2} />
      <div style={styles.body}>
        <TextField id="standard-basic" label="Standard" variant="standard" />
      </div>
    </Panel>
  );
}
